Promotional info - &quot;RUE follows a mysterious figure who is targeting and killing everyone involved with the death and destruction of a town called Rue years before. As law and outlaw alike begin to fall, the remaining men responsible for the destruction of the town must put the clues together in an attempt to halt their own demise.&quot;

An original graphic novel by Michael Drace Fountain (Author), Marcel Losada (Author), James Ninness (Author), Joe Pezzula (Author), Scott Irwin (Illustrator). Thanks to Monafekk-Empire for this digital HD copy. Please seed, and enjoy! :-)

